const routes = require("next-routes")();

// defining different routes as per the requirement of the project
routes
  .add("/user/new", "/identityManagement/user/new")
  .add("/user/addlicence", "/identityManagement/user/addlicence")
  .add("/company/newrequest", "/identityManagement/company/newrequest");

module.exports = routes;
